Previously it was difficult to do polymorphic/covariant hotness such as...

``` javascript
function getSomething(): KnockoutObservable<T> {
    if (something) {
        return ko.computed(...);
    } else {
        return ko.observable(...);
    }
}
```

...because KnockoutComputed was not typed as a valid KnockoutObservable.

I updated KnockoutComputed to inherit from KnockoutObservable, therefore enabling this situation.

There was definitely some mistakes with fs interface:
fd is designed to be a number, not a string;
some callbacks formally are void functions;
synchronous read and write functions (don't confuse with fileWrite/Read) designed to return number of bytes read/written.

Now you can write:

``` ts
///<reference path='chai.d.ts'/>
import chai = require('chai');
chai.expect(true).to.be.true;
```

This PR originally failed on chai-jquery, but I fixed those issues too. Actually, chai-jquery wasn't really doing anything before now.

The filters in RefreshHints should be optional so there is no error when updating a single one such as:

``` javascript
this.dataView.setRefreshHints({
    isFilterUnchanged: true
});
```
